const MenuClose = (props) => {

	const close = () => {props.setShowMenu(false)}

	return (
		<div 
			onTouchStart={(el) => {close(el)}} 
			onclick={(el) => {close(el)}} 
			className="blocks menulink fallable noselect xposrandom menuclose" 
			style={{height:50,width:50,background:'#cccccc',display:"flex"}}
		>X</div>
	)
}

export default MenuClose
